import { Component } from 'react';
import { BrowserRouter, Switch, Route } from 'react-router-dom';
import { connect } from 'react-redux';

import Navbar from './client/Navbar/components/Navbar';

import HomePage from './client/HomePage';
import ContactsPage from './client/Contacts/pages/ContactsPage';
import RegisterPage from './client/RegisterPage';
import LoginPage from './client/LoginPage';
import NotFoundPage from './client/NotFoundPage';

import { getCurrentUser } from './redux/auth/auth-operations';
import PrivetRoute from './client/PrivetRoute';
import PublicRoute from './client/PublicRoute';

class App extends Component {
  componentDidMount() {
    this.props.onGetCurrentUser();
  }
  render() {
    return (
      <BrowserRouter>
        <Navbar />
        <Switch>
          <Route exact path="/" component={HomePage} />
          <PrivetRoute
            exact
            path="/contacts"
            component={ContactsPage}
            redirectTo="/login"
          />
          <Route exact path="/register" component={RegisterPage} />
          <PublicRoute exact path="/login" restricted component={LoginPage} />
          <Route component={NotFoundPage} />
        </Switch>
      </BrowserRouter>
    );
  }
}

const mapDispatchToProps = {
  onGetCurrentUser: getCurrentUser,
};

export default connect(null, mapDispatchToProps)(App);
